import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const OrderAdmin = () => {
  const [orders, setOrders] = useState([]);
  const [statusUpdate, setStatusUpdate] = useState({ orderId: "", status: "" });
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const res = await axios.get("http://localhost:8080/admin/orders");
      setOrders(res.data);
    } catch {
      setMessage("❌ Failed to fetch orders.");
    }
  };

  const handleStatusChange = (e) => {
    setStatusUpdate((prev) => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const updateStatus = async () => {
    const { orderId, status } = statusUpdate;

    if (!orderId || !status.match(/^(pending|completed|cancelled)$/i)) {
      setMessage("❌ Invalid input. Use: pending, completed, or cancelled.");
      return;
    }

    try {
      await axios.put(`http://localhost:8080/admin/orders/${orderId}/status`, null, {
        params: { status },
      });
      setMessage("✅ Order status updated.");
      setStatusUpdate({ orderId: "", status: "" });
      fetchOrders();
    } catch {
      setMessage("❌ Failed to update order.");
    }
  };

  return (
    <div className="p-6 min-h-screen bg-gray-50">
      <button
        className="mb-6 px-4 py-2 bg-blue-500 text-white rounded"
        onClick={() => navigate("/admin")}
      >
        🔙 Back to Admin Dashboard
      </button>

      <h1 className="text-3xl font-bold mb-4">🧾 Order Administration</h1>

      {message && <p className="text-blue-700 mb-4">{message}</p>}

      {/* Status update form */}
      <div className="bg-white p-4 rounded shadow mb-8 max-w-xl">
        <h3 className="font-bold mb-2">🛠️ Update Order Status</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <input
            type="number"
            name="orderId"
            placeholder="Order ID"
            value={statusUpdate.orderId}
            onChange={handleStatusChange}
            className="p-2 border rounded"
          />
          <input
            name="status"
            placeholder="Statuspending/completed/cancelled"
            value={statusUpdate.status}
            onChange={handleStatusChange}
            className="p-2 border rounded"
          />
        </div>
        <button
          onClick={updateStatus}
          className="mt-4 bg-yellow-500 hover:bg-yellow-600 text-white px-4 py-2 rounded"
        >
          ✅ Update Status
        </button>
      </div>

      {/* Orders list */}
      <h2 className="text-xl font-bold mb-4">📋 All Orders</h2>
      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
        {orders.map((order) => (
          <div key={order.orderId} className="bg-white shadow-md rounded p-4 space-y-2">
            <h3 className="text-lg font-bold text-purple-700">Order #{order.orderId}</h3>
            <p>User ID: {order.userId}</p>
            <p>Total: ${order.totalPrice.toFixed(2)}</p>
            <p>Status: <span className="font-semibold text-blue-600">{order.status.name}</span></p>
            <p>Date: {new Date(order.createdAt).toLocaleDateString()}</p>

            {order.orderItems?.length > 0 && (
              <div>
                <p className="text-sm font-semibold mt-2">🧾 Items:</p>
                <ul className="list-disc pl-4 text-sm text-gray-700 space-y-1">
                  {order.orderItems.map((item) => (
                    <li key={item.orderItemId}>
                      {item.product.name} × {item.quantity} = $
                      {(item.product.price * item.quantity).toFixed(2)}
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default OrderAdmin;
